member.example:
This sample shows how to call NoOperationParamsAsync.

Uri endpoint = new Uri("<https://my-service.azure.com>");
MultipleClient client = new MultipleClient(endpoint);

Response response = await client.NoOperationParamsAsync();
Console.WriteLine(response.Status);

This sample shows how to call NoOperationParams.

Uri endpoint = new Uri("<https://my-service.azure.com>");
MultipleClient client = new MultipleClient(endpoint);

Response response = client.NoOperationParams();
Console.WriteLine(response.Status);

This sample shows how to call WithOperationPathParamAsync with required parameters.

Uri endpoint = new Uri("<https://my-service.azure.com>");
MultipleClient client = new MultipleClient(endpoint);

Response response = await client.WithOperationPathParamAsync("<keyword>");
Console.WriteLine(response.Status);

This sample shows how to call WithOperationPathParam with required parameters.

Uri endpoint = new Uri("<https://my-service.azure.com>");
MultipleClient client = new MultipleClient(endpoint);

Response response = client.WithOperationPathParam("<keyword>");
Console.WriteLine(response.Status);
